import React from "react";
import { createBrowserRouter, RouterProvider } from "react-router-dom";
import Adminhome from "./Adminhome";
import AdminResister from "./AdminResister";
import ADMINLOGIN from "./ADMINLOGIN";

// Error boundary component to catch routing errors
function ErrorBoundary() {
  return <h1>Oops! Something went wrong. Page not found.</h1>;
}

const router = createBrowserRouter([
  {
    path: "/adminhome",
    element: <Adminhome />,
  },
  {
    path: "/adminresister",
    element: <AdminResister />,
  },
  {
    path: "/adminlogin",
    element: <ADMINLOGIN />,
  },
  {
    path: "*", // Catch-all route for undefined paths
    element: <ErrorBoundary />, // Show custom error page for unknown paths
  },
]);

export default function App() {
  return <RouterProvider router={router} />;
}
